import '../styles/Header.css';
import { Link } from 'react-router-dom'

export default function Header() {
    const user = JSON.parse(localStorage.getItem('user'));

    return(
        <header>
            <h1 className='logo'>RiskPRFM</h1>
            {user ? 
            <button></button> :
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>FAQs</li>
                <li>Contact</li>
            </ul>}}
        </header>
    )
}
